import { HomepageBody } from "./homepage-body";
import "./homepage.css";

const Homepage = () => {
  return (
    <section className="homepage-section">
      <div className="homepage-bg-video">
        <video className="bg-video autoPlay loop muted">
          <source src="images/chart.mp4" type="video/mp4" />
        </video>
      </div>
      <div className="homepage-hero p-up-6 width-100 center-text">
        <div className="hero-text">
          <div className="textbox">
            <div className="hero-title center-text flex-row align-center">
              TRADE<span className="is-primary">PLAY</span>{" "}
              <i className="fas m-l-2 is-6 is-primary fa-play"></i>
            </div>
            <div className="subtitle is-dark is-4 light center-text">
              Curated videos to learn trading the fast way
            </div>
          </div>
          <button className="btn-primary btn-medium br-1">
            Start Learning
          </button>
        </div>
      </div>
      <HomepageBody />
    </section>
  );
};

export { Homepage };
